import axios from 'axios';

const getDadosCep = async (cep) => {
  try {
    const c = cep.replace('-','');
    const response = await axios.get(`https://viacep.com.br/ws/${c}/json/`);
    return response.data;
  } catch (error) {
    return true;
  }
};

export default getDadosCep;
